import Link from "next/link"
import { useState, useEffect } from "react"
import Cart from "../components/cart/Cart"
import Layout from "../components/layout/Layout"
import { getCart } from "../utils/cart.util"

const CartPage = () => {
    const [cart, setCart] = useState()
    console.log(cart)

  useEffect(() => {
    if (getCart()) {
      let comparedCart = getCart()
      if (!cart) {
        setCart(comparedCart)
      }
      else if (comparedCart.totalProductsPrice !== cart.totalProductsPrice) {
        setCart(getCart())
      }
    }
  }, [getCart])

  return (
      <Layout>
        {
          cart ?
          <Cart cart={cart} />
          :
          <h3>
            There is no product here, 
            <Link href="/"><a>Start shopping</a></Link>
          </h3>
        }
      </Layout>
  )
}

export default CartPage
